</head>

<body>

    <!-- <style>
        path:not([fill="black"]) {
            display: none;
        }
    </style> -->

    <!-- 
    <button onclick="eliminar()">Eliminar</button>
    <button onclick="eliminarpath()">eliminarpath</button>
    -->


    <script>
        function eliminarpath() {
            // Selecciona todos los elementos <path>
            const paths = document.getElementsByTagName('path');

            // Recorre cada elemento <path>
            for (let i = 0; i < paths.length; i++) {
                const path = paths[i];

                // Si el atributo fill es distinto a black
                if (path.getAttribute('fill') !== 'black') {
                    // Elimina el elemento <path>
                    path.parentNode.removeChild(path);
                }
            }
        }

    </script>

    <script>
        function eliminar() {
            // Selecciona todos los elementos <path> dentro del SVG
            const paths = document.querySelectorAll('path');

            // Recorre cada elemento <path>
            paths.forEach(path => {
                // Verifica si el atributo 'stroke' es igual a 'RGB(147,149,152)'
                if (path.getAttribute('fill') === '#1214F7' || path.getAttribute('stroke') === 'yellow' || path.getAttribute('stroke') === 'fuchsia' ||
                    path.getAttribute('stroke') === 'RGB(255,127,127)') {
                    // Elimina el elemento <path> si cumple con la condici√≥n
                    path.remove();
                }
            });
        }
    </script>
